import React from "react";

function Hero() {
  return (
    <section className="bg-blue-700 text-white py-20 mt-16">
      <div className="bg-[#F7F7F7] text-[#1E40AF] p-10 rounded-xl">
        <h1 className="text-4xl font-bold">Light Gray Theme Test</h1>
        <p className="mt-2 text-lg">
          This is the light gray + royal blue palette.
        </p>
      </div>
    </section>
  );
}

export default Hero;
